  <script>
  var b1 = 500; var b2 = 300;
  function visib (tag, state, timeout) {
    var bl = document.getElementsByName(tag);
    var vv; if (state) vv = 'visible'; else vv = 'hidden';
    var i;
    for (i = 0; i < bl.length; i++) {
      bl[i].style.visibility = vv;
    }
    window.setTimeout ('visib ("' + tag + '", ' + !state + ', ' + timeout + ')', timeout);
  }
  function setup () {
    window.setTimeout ('visib ("blink", 0, b1)', b1);
    window.setTimeout ('visib ("rapid", 0, b2)', b2);
  }
